import './HamburgerMenu.css';
import hamburgerMenu from './images/hamburgerMenu.svg';

const toggleHamburguerMenu = () => {
  const menu = document.querySelector('hamburger-container')
  menu.classList.remove('active')
};

function HamburgerMenu() {
  return (
    <hamburger-container>
      <button onClick={toggleHamburguerMenu} className="close">
        <img src={hamburgerMenu} className='hamburgerMenu' alt="hamburger menu" />
      </button>
      <a href="#section-id">Home</a>
      <a href="#section-id">Home</a>
    </hamburger-container>
  );
}

export default HamburgerMenu;
